	public Customer customer(String code, String name, String ragSocial,
			String iva, String codeAddress, String homeAddress, String cap,
			String phone, String fax, String email, String site,
			String civicNumber, String province, String town, String city,
			byte[] image, String description, int length, String nameFile,
			boolean isMulti, String hexCode) throws Exception {
		Customer customer = new Customer();
		customer.setCode(code);
		customer.setName(name);
		customer.setRagSocial(ragSocial);

		Address address = new Address();
		address.setCode(codeAddress);
		address.setAddress(homeAddress);
		address.setCap(cap);
		address.setCity(city);
		address.setCivicNumber(civicNumber);
		address.setEmail(email);
		address.setFax(fax);
		address.setPhone(phone);
		address.setSite(site);
		address.setTown(town);
		address.setProvince(province);

		customer.setAddress(address);

		if (image != null) {
			ArrayList<Data> listData = new ArrayList<Data>();
			Data data = new Data();
			data.setData(image);
			data.setDescription(description);
			data.setLength(length);
			data.setName(nameFile);
			listData.add(data);
			if (isMulti) {
				Data data2 = new Data();
				data2.setData(image);
				data2.setDescription("nuova descrizione");
				data2.setLength(98);
				data2.setName("nuovo nome");
				listData.add(data2);
			}
			customer.setFiles(listData);
		}

		java.io.ObjectOutputStream oos = new java.io.ObjectOutputStream(
				new java.io.FileOutputStream(tempFile));
		oos.writeObject(customer);
		oos.close();
		byte[] bytes = new byte[13100];
		java.io.FileInputStream fis = new java.io.FileInputStream(tempFile);
		fis.read(bytes);
		fis.close();
		String result = toHexString(bytes);
		System.out.println(result);
		java.io.ObjectInputStream ois = new java.io.ObjectInputStream(
				new java.io.ByteArrayInputStream(bytes));
		Customer customerRead = (Customer) ois.readObject();
		Assert.assertEquals(customerRead.getRagSocial(), ragSocial);
		Assert.assertEquals(result, hexCode);
		ois.close();
		return customerRead;
	}
